import React from 'react'
import { Link } from "react-router-dom";

function footer() {
    return(
        <div>
            <div className='footerContainer'>
                <div className='footerContentContainer'>
                    <h5>Designed and developed by James Malone</h5>
                    <Link to="https://github.com/jmalone801">GitHub</Link>
                    <Link to="https://www.linkedin.com/in/jamesemalone/">LinkedIn</Link>
                </div>
            </div>
        </div>
    )
}
export default footer
